import React, { useState } from 'react';
import './cell.css';
import styled from 'styled-components';



type CellProps = {
  id: string;
};
export const Cell = ({ id }: CellProps) => {
  const [isBlack,setIsBlack] = useState<boolean>(false)

  return (
    <SButton onClick={() => setIsBlack()} className="square">
      {id}
    </SButton>
  );
};
export default Cell;

const SButton = styled.button`
  background: #008000;
  border: 3px solid #000;
  height: 12.5%;
  width: 12.5%;
  cursor: pointer;
`;
